object Solution {
    def numberOfPowerfulInt(start: Long, finish: Long, limit: Int, s: String): Long = {
        if (s.toLong > finish) return 0 // s is greater than finish, no powerful integer possible

        val sLong = s.toLong
        if (sLong < start) {
            // Calculate the range of numbers that can be prefixed to s to stay within [start, finish]
            var count = 0L
            for (i <- 1 to s.length) {
                val prefixLimit = Math.pow(10, i).toLong
                for (j <- 0 until prefixLimit.toInt) {
                    val num = (j.toString + s).toLong
                    if (num >= start && num <= finish && j.toString.forall(c => c.asDigit <= limit)) {
                        count += 1
                    }
                }
            }
            count
        } else {
            // s itself is within the range, check if it satisfies the condition
            if (sLong >= start && sLong <= finish && s.forall(c => c.asDigit <= limit)) 1 else 0
        }
    }
}
